import React from "react";

const HeaderComponent = () => {
  return (
    <div className="table-row border-b-2 bg-white">
      <div className="h-24">
        <div className="text-cente fixed top-0 w-full">
          <header>
            <div>
              <ul>
                <li>메뉴1</li>
                <li>메뉴2</li>
                <li>메뉴3</li>
              </ul>
            </div>
          </header>
        </div>
      </div>
    </div>
  );
};

export default HeaderComponent;
